import React from 'react';
import './App.css'; 

const Siatka = () => {
  const grid = [];
  for (let i = 0; i < 10; i++) {
    for (let j = 0; j < 10; j++) {
      grid.push(<div key={`${i}-${j}`} className="grid-item"></div>);
    }
  }

  return (
    <div className="grid">
      {grid}
    </div>
  );
};

export default Siatka;
